  <div style={{ display: "block", margin: 0, position: "absolute", backgroundColor: "black", height: "100%", width: "100%" }}>
    <div style={{ height: "8%", width: "80%", backgroundColor: "#333", textAlign: "center", padding: "20% 10% 10% 10%" }}>
      <div>NOW PLAYING</div>
      <div>ARTIST - SONG NAME</div>
    </div>

    <div style={{ height: "10%", width: "100%", backgroundColor: "#333", position: "absolute", bottom: 0 }}>
      <div>NOW PLAYING</div>
      <div>ARTIST - SONG NAME</div>
    </div>
  </div>
);

export default MusicPlayer;
